import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormHelperText from '@mui/material/FormHelperText';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

export default function SelectLabelscourt() {
    const [court, setcourt] = React.useState('');
    const [time, settime] = React.useState('');

    const handleChange = (event) => {
        setcourt(event.target.value);
        settime(event.target.value);
    };


    return (
        <div>
            <FormControl sx={{ m: 1, minWidth: 120 }}>
                <InputLabel id="demo-simple-select-helper-label">court type</InputLabel>
                <Select
                    labelId="demo-simple-select-helper-label"
                    id="demo-simple-select-helper"
                    value={court}
                    label="court type"
                    onChange={handleChange}
                >
                    <MenuItem value="">
                        <em>None</em>
                    </MenuItem>
                    <MenuItem value={10}>tennis</MenuItem>
                    <MenuItem value={20}>basketball</MenuItem>
                    <MenuItem value={30}>football</MenuItem>
                    <MenuItem value={30}>volleyball</MenuItem>
                </Select>
                <FormHelperText>choose your sport's court</FormHelperText>
            </FormControl>
            <FormControl sx={{ m: 1, minWidth: 120 }}>
                <Select
                    value={time}
                    onChange={handleChange}
                    displayEmpty
                    inputProps={{ 'aria-label': 'Without label' }}
                >
                    <MenuItem value="">
                        <em>None</em>
                    </MenuItem>
                    <MenuItem value={10}>5-6</MenuItem>
                    <MenuItem value={20}>6-7</MenuItem>
                    <MenuItem value={30}>8-9</MenuItem>
                </Select>
                <FormHelperText>select time</FormHelperText>
            </FormControl>
        </div>
    );
}
